(function(){
  // --- Построим обратную мапу Windows-1251 → байт ---
  const allBytes = new Uint8Array(256);
  for(let i = 0; i < 256; i++) allBytes[i] = i;
  const win1251Str = new TextDecoder('windows-1251').decode(allBytes);
  const revMap = {};
  for(let i = 0; i < 256; i++){
    revMap[win1251Str[i]] = i;
  }

  // --- Функция восстановления UTF-8 из «кракозябр» ---
  function fixEncoding(brokenStr) {
    const bytes = [];
    for (let ch of brokenStr) {
      // если символ известен в revMap — берём его байт, иначе — младший байт UTF-16-кода
      bytes.push(revMap[ch] !== undefined ? revMap[ch] : (ch.charCodeAt(0) & 0xFF));
    }
    return new TextDecoder('utf-8').decode(new Uint8Array(bytes));
  }

  // --- Считываем всю страницу как текст и декодируем ---
  const broken = document.body.textContent;
  const fixed = fixEncoding(broken);

  // --- Перезаписываем страницу чистым текстом в <pre> (сохраняя все спецсимволы) ---
  document.open();
  document.write('<!DOCTYPE html><html><head><meta charset="utf-8"></head><body>');
  document.write('<pre style="white-space: pre-wrap; word-wrap: break-word;">'
                  + fixed
                    .replace(/&/g, '&amp;')
                    .replace(/</g, '&lt;')
                    .replace(/>/g, '&gt;')
                    .replace(/"/g, '&quot;')
                    .replace(/'/g, '&#39;')
                  + '</pre>');
  document.write('</body></html>');
  document.close();
})();
